function Card(props) {
    return (
        <div className="card">
            <img className="ml-15" src="/img/Expocentre-logo.svg" height={170} width={150} />
            <h5>{props.title}</h5>
            <div className="d-flex justify-between align-center">
                <div className="d-flex flex-column">
                    <span>Количество оборудования:<b>{props.count}</b></span>
                </div>
                <button className="button">
                    <img height={32} width={32} src={props.imgUrl} />
                </button>
            </div>
        </div>
    );
};

export default Card;
